import { createMuiTheme } from '@material-ui/core/styles';
import pink from '@material-ui/core/colors/pink';


const theme = createMuiTheme({
    video: {
      width: "1%"
    },
    palette: {
      type: 'dark',
      primary: {
          main: pink[500],
          dark: pink[900],
          light: pink[300]
      }
    }
  })


export default theme
